import uploadMixin from '@/components/Jnpf/Upload/vue-simple-uploader/mixin'
import { documentMerge } from '@/api/extend/document'
import qs from 'qs'

export default {
  props: ['parentId'],
  mixins: [uploadMixin],
  data() {
    return {

    }
  },
  methods: {
    handelSuccess(file) {
      const query = {
        identifier: file.uniqueIdentifier,
        fileName: file.name.replaceAll('#', ''),
        fileSize: file.size,
        fileType: file.getType(),
        extension: file.getExtension(),
        parentId: this.parentId,
      };
      documentMerge(qs.stringify(query)).then(res => {
        // 自定义完成状态
        this.$set(file, 'customCompleted', true)
        this.$emit('fileSuccess', res.data)
      }).catch(() => {
        file.cancel()
        this.$message.error(`上传失败`)
      })
    },
    onComplete() {
      this.uploader.cancel();
      this.panelShow = false;
    }
  }
}
